c.detail:
Poisoned Net Trap: DC 10 to find, DC 10 to disable;
    affects all targets within a 10 ft. square area, DC 20 save or take 18d10 poison damage
    and become restrained, half damage on a successful save

m.detail:
Freeze Bomb: DC 10 to find, DC 15 to disable;
    affects all targets within 20 ft., DC 20 save or take 18d10 cold damage
    and become restrained for 1d4 rounds
